import { longestCharGap2 } from '../longestCharGap'

describe("longestCharGap2", () => {
  test('Input: "ABCXYCPQMBAC", Output: 9', () => {
    expect(longestCharGap2("ABCXYCPQMBAC")).toBe(9)
  })

  test('No gaps or gaps of length 0', () => {
    expect(longestCharGap2("")).toBe(0)
    expect(longestCharGap2("A")).toBe(0)
    expect(longestCharGap2("GG")).toBe(0)
    expect(longestCharGap2("XXXXXXXXXXXXXXXXXXXX")).toBe(0)
    expect(longestCharGap2("asdfghjklqwertyuiopzxcvbnm")).toBe(0)
    expect(longestCharGap2("aassddffgghhjjkkllqqwweerrttyyuuiiooppzzxxccvvbbnnmm")).toBe(0)
  })

  test('Second smallest possible gap', () => {
    expect(longestCharGap2("POP")).toBe(1)
  })

  test('Two gaps of same character diff length', () => {
    expect(longestCharGap2("UXYZUIU")).toBe(3)
  })

  test('Two gaps of diff character same length', () => {
    expect(longestCharGap2("UXYZUIX")).toBe(4)
  })

  test('Two gaps of diff character diff length', () => {
    expect(longestCharGap2("UXYZLIXU")).toBe(6)
  })

  test.only('Biggest gap', () => {
    expect(longestCharGap2("")).toBe(0)
  })
})

